import React from "react";
import AccountItem from "../blocks/AccountItem";


export default function Account() {

    const user = {
        name: 'Anna',
        mail: 'pochta@gmail.com',
        points: 1000,
        completedExs: 100
    }

    return (
        <div className="Account container">

            <div className="Account__bio">
                <div className="Account__avatar"></div>
                <div>
                    <AccountItem value={user.name} title="Имя" />
                    <AccountItem value={user.mail} title="Почта" />
                    <AccountItem value="1000" title="Баллы" />
                    <AccountItem value="100" title="Пройдено упражнений" />
                </div>

                <button type="button" className="Account__save">Save</button>
            </div>

        </div>
    )
}
